import React, { Component } from 'react';

class CreateCustomerComponent extends Component {
    constructor(props){
        super(props)
        this.state={
            firstName:"",
            lastName:"",
            email:""
        }

    }
    render() {
        return (
            <div className='container'>
            <div className='row'>
                <div className='card col-md-6 offset-md-3 offset-md-3'>
                    <h3 className='text-center'>Sign Up</h3>
                    <div className='card-body'>
                        <form>
                            <div className='form-group'>
                                <label>First Name:</label>
                                <input placeholder='First Name' name='firstName' className='form-control' value={this.state.firstName}></input>
                                <label>Last Name:</label>
                                <input placeholder='Last Name' name='lastName' className='form-control'></input>
                                <label>Email:</label>
                                <input placeholder='Email' name='email' className='form-control'></input>
                            </div>

                        </form>
                    </div>


                </div>
            </div>
            </div>

        );
    }
}

export default CreateCustomerComponent;
